import React from 'react';

import NavigationButton from './../../components/NavigationButton.js'
import './Mode.css';

function Mode() {
  return (
    <div className="Landing">
      <div className="Text">
        <div className="Text-title">
            Choose a mode.
        </div>
        <NavigationButton link="/begin" text="Assisted mode"/>
        <NavigationButton link="/begin" text="Individual mode"/>
        <div className="Text-subtitle">
            WHAT DOES THIS MEAN?
        </div>
      </div>
    </div>
  );
}

export default Mode;
